var svSE={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Tillåta","Allow in your wallet":"Tillåt i din plånbok","Allow {symbol} first":["Tillåt ",["symbol"]," först"],"Allowance pending":"Ersättning väntar","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Ett fel uppstod när det här försöket skulle genomföras. Du kan behöva öka din glidningstolerans. Om det inte fungerar kan det finnas en inkompatibilitet med det token du handlar. Obs: avgift för överföring och rebase-tokens är oförenliga med Uniswap V3.","Approval pending":"Godkännande väntar","Approve":"Godkänn","Approve Permit2":"Approve Permit2","Approve in your wallet":"Godkänn i din plånbok","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Godkänn ",["symbol"]," först"],"Auto":"Automatiskt","Auto Router":"Auto Router","Auto Router API":"Auto Router API","Balance:":"Saldo:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Stäng","Confirm in your wallet":"Bekräfta i din plånbok","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Anslut plånbok","Connecting…":"Ansluter…","Continue":"Continue","Convert {0} to {1}":["Konvertera ",["0"]," till ",["1"]],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"Koppla bort plånboken","Dismiss":"Avfärda","Enter an amount":"Ange ett belopp","Error fetching trade":"Fel vid hämtning av handel","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"Får bästa pris…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"Hög glidning ökar risken för prisrörelser","I don't have a wallet":"Jag har ingen plånbok","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["Otillräckligt ",["0"]," saldo"],"Invalid recipient":"Ogiltig mottagare","Max":"Högst","Max slippage":"Max glidning","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Beroenden saknas","Network fee":"Nätverksavgift","No results found.":"Inga resultat hittades.","No tokens are available on this network. Please switch to another network.":"Inga tokens är tillgängliga på detta nätverk. Byt till ett annat nätverk.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Vänligen ange en giltig glidning %","Powered by the Uniswap protocol":"Drivs av Uniswap-protokollet","Price impact":"Prispåverkan","Price updated":"Pris uppdaterat","Reload":"Reload","Reload the page":"Ladda om sidan","Request rejected":"Request rejected","Review swap":"Recensionsbyte","Search by token name or address":"Sök på tokennamn eller adress","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Något gick snett","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Framgång","Swap":"Byt","Swap failed: {0}":["Byte misslyckades: ",["0"]],"Switch network":"Byt nätverk","Switch network in your wallet":"Byt nätverk i plånboken","Switching network":"Byter nätverk","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"Uniswap-invarianten x * y = k var inte nöjd med bytet. Detta innebär vanligtvis att ett av de token du byter innehåller anpassat beteende vid överföring.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"Inmatningstoken kan inte överföras. Det kan finnas ett problem med inmatningtoken.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"Utmatningstoken kan inte överföras. Det kan finnas ett problem med utmatningtoken.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Utmatningstoken kan inte överföras. Det kan finnas ett problem med utmatningtoken. Obs att avgifter för överföring och rebase-tokens är oförenliga med Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Denna transaktion kommer inte att lyckas på grund av prisrörelser. Försök öka din toleransmarginal. Obs att avgifter vid överföring och rebase-tokens är oförenliga med Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Denna transaktion kommer inte att lyckas antingen på grund av prisrörelser eller avgift vid överföring. Försök att öka din toleransmarginal.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Tidsfrist för transaktion","Transaction rejected":"Transaktionen avvisad","Transaction submitted":"Transaktionen har skickats","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Försök att öka din glidtolerans.<0/>OBS: Avgift för överföring och rebase-tokens är inkompatibla med Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Oväntat fel. Det gick inte att uppskatta gasen för bytet.","Unexpected issue with estimating the gas. Please try again.":"Oväntat problem med att uppskatta gasen. Var god försök igen.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Visa på Etherscan","Wallet disconnected":"Wallet disconnected","Warning":"Varning","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Din transaktion kommer att återställas om den har varit väntande längre än denna tidsperiod.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Din transaktion kommer att återgå om priset ändras ogynnsamt med mer än denna procentsats.","minutes":"minuter","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," avgift"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

